import React from 'react'
import styled from "styled-components"

const PerfilContainer = styled.div`
        
    height: 100px;
    display: flex;
    align-items: center;
    justify-content: space-around;
    border-bottom-style: groove;
`




const Header = () => {
    return (
        <PerfilContainer>
            Perfil
        </PerfilContainer>
    )

}

export default Header
